import { configureStore } from '@reduxjs/toolkit';
import setTokenReducer from './features/usersLogin'
import setUsersReducer from './features/usersLogin'

export default configureStore({
    reducer: {
        usersLogin: setTokenReducer, setUsersReducer,

    },
});
